s will ich nicht. also bitte nix verraten, ja? aber vielleicht merkt er es ja nicht. das w\u00e4re gut, denn wer hat schon lust einen deprimierten blindtext auf seiner seite zu platzieren. was w\u00fcrde denn das f\u00fcr einen eindruck machen. das will ja keiner lesen. somit w\u00e4re er dann ein f\u00fcr alle mal tats\u00e4chlich v\u00f6llig nutzlos. das w\u00e4re sein todesurteil. soweit wollen wir es doch nicht kommen lassen, oder? es sei denn, und das ist m\u00f6glich, er w\u00fcrde wiedergeboren und k\u00e4me als, naja, sagen wir als witz, und ein textleben sp\u00e4ter vielleicht als bildzeitungsartikel auf die textwelt. irgendwann w\u00e4re er vielleicht sogar ein text im lexikon. dann h\u00e4tten wir ihn ja sogar weitergebracht in seiner entwicklung. klingt gar nicht schlecht, oder? trotzdem bin ich der meinung, man sollte ihn nicht bewusst dort hin treiben. er hat ein recht darauf, sich selbst zu entwickeln. und zwar in genau dem tempo, das ihm gef\u00e4llt. und bis es soweit ist, nehme ich ihn eben an, wie er ist. als einfachen blindtext ohne wirklichen inhalt.\"\n      \"teaser-area\" => \"dieser text hat eigentlich gar keinen wirklichen inhalt. aber er hat auch keine relevanz, und deswegen ist das egal. er dient lediglich als platzhalter. um mal zu zeigen, wie diese stelle der seite aussieht, wenn ein paar zeilen vorhanden sind.\"\n      \"hauptbild\" => \"{\"key\":\"plg_fields_econa_62caf1b194412\",\"itemId\":null,\"context\":\"com_content.article\",\"filename\":\"\",\"ratios\":[{\"label\":\"2\/1\",\"value\":2}],\"free_ratio\":\"0\",\"params\":{\"sizes\":{\"sizes0\":{\"label\":\"Small\",\"identifier\":\"S\",\"width\":\"400\",\"quality\":\"100\"},\"sizes1\":{\"label\":\"Medium\",\"identifier\":\"M\",\"width\":\"600\",\"quality\":\"100\"},\"sizes2\":{\"label\":\"Large\",\"identifier\":\"L\",\"width\":\"900\",\"quality\":\"100\"}},\"jpeg\":\"1\",\"webp\":\"1\",\"media\":\"1\",\"css\":\"1\",\"auto_edit\":\"1\",\"aspect_ratios\":{\"aspect_ratios0\":{\"ratio\